// ConversationsServer is the server API for Conversations service.
// All implementations should embed UnimplementedConversationsServer
// for forward compatibility
type ConversationsServer interface {
	// Creates a new conversation. Conversations are auto-completed after 24
	// hours.
	//
	// Conversation Lifecycle:
	// There are two stages during a conversation: Automated Agent Stage and
	// Assist Stage.
	//
	// For Automated Agent Stage, there will be a dialogflow agent responding to
	// user queries.
	//
	// For Assist Stage, there's no dialogflow agent responding to user queries.
	// But we will provide suggestions which are generated from conversation.
	//
	// If
	// [Conversation.conversation_profile][google.cloud.dialogflow.v2beta1.Conversation.conversation_profile]
	// is configured for a dialogflow agent, conversation will start from
	// `Automated Agent Stage`, otherwise, it will start from `Assist Stage`. And
	// during `Automated Agent Stage`, once an
	// [Intent][google.cloud.dialogflow.v2beta1.Intent] with
	// [Intent.live_agent_handoff][google.cloud.dialogflow.v2beta1.Intent.live_agent_handoff]
	// is triggered, conversation will transfer to Assist Stage.
	CreateConversation(context.Context, *CreateConversationRequest) (*Conversation, error)
	// Returns the list of all conversations in the specified project.
	ListConversations(context.Context, *ListConversationsRequest) (*ListConversationsResponse, error)
	// Retrieves the specific conversation.
	GetConversation(context.Context, *GetConversationRequest) (*Conversation, error)
	// Sets a phone number for this conversation to connect to.
	// Note: The conversation in the request must be in IN_PROGRESS status and
	// must have no phone number attached.
	AddConversationPhoneNumber(context.Context, *AddConversationPhoneNumberRequest) (*ConversationPhoneNumber, error)
	// Activates the specified conversation.
	// Used for telephony-based conversations that are started with inactive
	// SIP attribute.
	ActivateConversation(context.Context, *ActivateConversationRequest) (*Conversation, error)
	// Deactivates the specified conversation.
	// Sets the SDP direction of the telephony call associated with this
	// conversation to inactive.
	DeactivateConversation(context.Context, *DeactivateConversationRequest) (*Conversation, error)
	// Completes the specified conversation. Finished conversations are purged
	// from the database after 30 days.
	CompleteConversation(context.Context, *CompleteConversationRequest) (*Conversation, error)
	// Updates the specified conversation.
	UpdateConversation(context.Context, *UpdateConversationRequest) (*Conversation, error)
	// Data ingestion API.
	// Ingests context references for an existing conversation.
	IngestContextReferences(context.Context, *IngestContextReferencesRequest) (*IngestContextReferencesResponse, error)
	// Creates a call matcher that links incoming SIP calls to the specified
	// conversation if they fulfill specified criteria.
	CreateCallMatcher(context.Context, *CreateCallMatcherRequest) (*CallMatcher, error)
	// Returns the list of all call matchers in the specified conversation.
	ListCallMatchers(context.Context, *ListCallMatchersRequest) (*ListCallMatchersResponse, error)
	// Requests deletion of a call matcher.
	DeleteCallMatcher(context.Context, *DeleteCallMatcherRequest) (*emptypb.Empty, error)
	// Batch ingests messages to conversation. Customers can use this RPC to
	// ingest historical messages to conversation.
	BatchCreateMessages(context.Context, *BatchCreateMessagesRequest) (*BatchCreateMessagesResponse, error)
	// Lists messages that belong to a given conversation.
	// `messages` are ordered by `create_time` in descending order. To fetch
	// updates without duplication, send request with filter
	// `create_time_epoch_microseconds >
	// [first item's create_time of previous request]` and empty page_token.
	ListMessages(context.Context, *ListMessagesRequest) (*ListMessagesResponse, error)
	// Exports messages from a range of conversations to a Google Cloud Storage
	// bucket. Each conversation is exported as a separate JSON transcript to the
	// bucket. Only closed conversations are exported, and if redaction is
	// configured, the exported text messages are redacted as well.
	// Note: this method is pre-alpha and is subject to incompatible changes.
	ExportMessages(context.Context, *ExportMessagesRequest) (*longrunningpb.Operation, error)
	// Suggest summary for a conversation based on specific historical messages.
	// The range of the messages to be used for summary can be specified in the
	// request.
	SuggestConversationSummary(context.Context, *SuggestConversationSummaryRequest) (*SuggestConversationSummaryResponse, error)
	// Generates and returns a summary for a conversation that does not have a
	// resource created for it.
	GenerateStatelessSummary(context.Context, *GenerateStatelessSummaryRequest) (*GenerateStatelessSummaryResponse, error)
	// Generates and returns a suggestion for a conversation that does not have a
	// resource created for it.
	GenerateStatelessSuggestion(context.Context, *GenerateStatelessSuggestionRequest) (*GenerateStatelessSuggestionResponse, error)
	// Suggest key moments for a conversation based on specific historical
	// messages.
	SuggestConversationKeyMoments(context.Context, *SuggestConversationKeyMomentsRequest) (*SuggestConversationKeyMomentsResponse, error)
	// Gets relevant articles by performing a search using the given query.
	SearchArticles(context.Context, *SearchArticlesRequest) (*SearchArticlesResponse, error)
	// For the Call Companion UI, gets all Call Companion
	// conversation events that have occurred so far.
	ListPastCallCompanionEvents(context.Context, *ListPastCallCompanionEventsRequest) (*ListPastCallCompanionEventsResponse, error)
	// For the Call Companion UI, gets the incoming
	// conversation events as a server-side stream.
	StreamingListUpcomingCallCompanionEvents(*StreamingListUpcomingCallCompanionEventsRequest, Conversations_StreamingListUpcomingCallCompanionEventsServer) error
	// For the Call Companion UI, injects a conversation event
	// which is a user input into the conversation.
	InjectCallCompanionUserInput(context.Context, *InjectCallCompanionUserInputRequest) (*InjectCallCompanionUserInputResponse, error)
	// For the anonymous Call Companion UI to get conversation events as a stream.
	StreamingListCallCompanionEvents(*StreamingListCallCompanionEventsRequest, Conversations_StreamingListCallCompanionEventsServer) error
	// For the anonymous Call Companion UI, injects a conversation event
	// which is a user input into the conversation.
	InjectCallCompanionInput(context.Context, *InjectCallCompanionInputRequest) (*InjectCallCompanionInputResponse, error)
	// Initialize the resources for Call Companion UI.
	InitializeCallCompanion(context.Context, *InitializeCallCompanionRequest) (*emptypb.Empty, error)
	// Gets the settings for Call Companion UI.
	GetCallCompanionSettings(context.Context, *GetCallCompanionSettingsRequest) (*CallCompanionSettings, error)
	// Get answers for the given query based on knowledge documents.
	SearchKnowledge(context.Context, *SearchKnowledgeRequest) (*SearchKnowledgeResponse, error)
	// Generates all the suggestions using generators configured in the
	// conversation profile. A generator is used only if its trigger event is
	// matched.
	GenerateSuggestions(context.Context, *GenerateSuggestionsRequest) (*GenerateSuggestionsResponse, error)
	// Initiates an outbound phone call with this conversation.
	InitiatePhoneCall(context.Context, *InitiatePhoneCallRequest) (*InitiatePhoneCallResponse, error)
	// Injects input from a human supervisor into the conversation.
	InjectSupervisorInput(context.Context, *InjectSupervisorInputRequest) (*InjectSupervisorInputResponse, error)
	// Retrieves a interaction monitoring alert.
	GetInteractionMonitoringAlert(context.Context, *GetInteractionMonitoringAlertRequest) (*InteractionMonitoringAlert, error)
	// Returns the list of all interaction monitoring alerts in the specified
	// project.
	ListInteractionMonitoringAlerts(context.Context, *ListInteractionMonitoringAlertsRequest) (*ListInteractionMonitoringAlertsResponse, error)
	// Acks the specified interaction monitoring alert by marking it's state as
	// `ACKNOWLEDGED`.
	AckInteractionMonitoringAlert(context.Context, *AckInteractionMonitoringAlertRequest) (*InteractionMonitoringAlert, error)
	// Returns all interaction monitoring metrics in the specified conversation or
	// session context.
	ListInteractionMonitoringMetrics(context.Context, *ListInteractionMonitoringMetricsRequest) (*ListInteractionMonitoringMetricsResponse, error)
}

